$(document).ready(function(){$('form[class="form-signin"]').submit(function(t){$('p[id="error-msg"]').text(""),t.preventDefault(),$.ajax({url:"/api",type:"POST",data:{email:$('input[id="inputEmail"]').val(),password:$('input[id="inputPassword"]').val()},accepts:{text:"application/json; charset=utf-8"},success:function(t){location.href=t.redirect},error:function(t){$('p[id="error-msg"]').text(t.responseJSON.message||"something went wrong")}})}),$('button[id="button"]').click(function(){$.ajax({url:"/api/test",type:"POST",data:{email:"email",password:"password"},accepts:{text:"application/json; charset=utf-8"},success:function(t){location.href=t.redirect},error:function(t){$('p[id="error-msg"]').text(t.responseJSON.message||"something went wrong")}})})});